('brand10', 'NATURE MADE', 'https://wowmart.vn/wp-content/uploads/2015/10/NM-logo-1024x327-1000x319.jpg', 'Nature Made là thương hiệu thực phẩm chức năng bổ sung vitamin và khoáng chất hàng đầu của Mỹ, thuộc sở hữu của hãng dược phẩm Pharmavite. '),
('brand11', 'KIRKLAND SIGNATURE', 'https://bansihangmy.com/upload/images/kirkland.png', 'Kirkland Signature là thương hiệu thực phẩm chức năng thuộc tổng công ty Costco Wholesale - “Thương hiệu bán lẻ” lớn nhất ở Mỹ. Kirkland nổi tiếng về thực phẩm chức năng từ thiên nhiên và các sản phẩm chăm sóc sức khỏe ra đời từ năm 1995'),
('brand12', 'PURITAN’S PRIDE', 'https://onepharma.vn/wp-content/uploads/2022/03/puritans-pride-logo.jpg', 'Những ai đã tìm hiểu về thương hiệu thực phẩm chức năng nổi tiếng thế giới sẽ không còn xa lạ với cái tên Puritan’s Pride. Puritan’s Pride là công ty thành viên của Tập đoàn NBTY, 1 trong 4 tập đoàn sản xuất và phân phối thực phẩm chức năng/thực phẩm bảo vệ sức khỏe lớn nhất tại Mỹ và trên thế giới.'),
('brand13', 'HEALTHY CARE', 'https://drvitamin.vn/wp-content/uploads/2021/09/thuong-hieu-Healthy-Care.png', 'Một trong những thương hiệu thực phẩm chức năng tốt nhất trên thế giới hiện nay là Healthy Care đến từ nước Úc. Healthy Care tập trung nghiên cứu và phát triển các sản phẩm chăm sóc sức khỏe có nguồn gốc từ thiên nhiên hàng đầu của nước Úc.'),
('brand14', 'TRUNATURE', 'https://bensmartus.com/wp-content/uploads/2019/01/TPCN025-11.png', 'Thương hiệu thực phẩm chức năng TruNature bạn không thể bỏ qua khi chọn mua những sản phẩm bảo vệ sức khỏe. TruNature tiên phong là hãng dược đầu tiên sản xuất ra TruNature là hãng thực phẩm chức năng trực thuộc tổng công ty Costco Wholesale, “Thương hiệu bán lẻ” lớn nhất ở Mỹ.'),
('brand15', 'CHIFF NUTRITION INTERNATIONAL', 'https://cdn.nhathuocsuckhoe.com/unsafe/400x0/left/top/smart/filters:quality(75)/https://nhathuocsuckhoe.com/upload//manufacturer/1175012056_Schiff.jpg', 'Schiff là thương hiệu thực phẩm chức năng danh giá đến từ Mỹ, trực thuộc tập đoàn Schiff Nutrition International nổi tiếng. Với nhiều dòng sản phẩm chăm sóc sức khỏe chất lượng, Schiff luôn được người tiêu dùng trên toàn cầu đón nhận, trở thành biểu tượng sức khỏe của một cơ thể khỏe mạnh và dẻo dai.'),
('brand2', 'COLLAGEN YOUTHEORY', 'https://www.youtheory.com/cdn/shop/files/Youtheory_logo_MFAOY_4d76ecc4-6c76-4da3-a43c-8760c71ec018.png?v=1626128668&width=1024', 'Viên uống Collagen Youtheory cung cấp sự kết hợp nhẹ nhàng giữa collagen thủy phân loại 1, 2 và 3 với tinh chất vitamin C nồng độ cao. Không chỉ vậy, các thành phần trên còn được kết hợp với biotin. '),
('brand3', 'HERBALIFE', 'https://logosmarken.com/wp-content/uploads/2022/01/Herbalife-Logo.png', 'Herbalife là loại thực phẩm hoặc sản phẩm hỗ trợ phục hồi, bảo tồn hoặc cải thiện hoạt động của các cơ quan trong cơ thể. Ngoài ra, sản phẩm này còn cung cấp dinh dưỡng cơ bản, có tác dụng phòng và lành bệnh.'),
('brand4', 'UNICITY', 'https://thucphamchucnang360.com/images/images/Unicity.jpg', 'Unicity International là một công ty trong lĩnh vực sức khỏe có nhiều đánh giá tích cực. Unicity đã hoạt động tại Hoa Kỳ hơn 100 năm. Hầu hết các sản phẩm của Unicity là thực phẩm chất lượng được ưa chuộng vì chất lượng của chúng. '),
('brand5', 'VISION SUPREFIBER', 'https://shopvulinh.com/wp-content/uploads/2015/10/Vision-logo.gif', 'Vision SupreFiber là một sản phẩm của dòng giảm cân Vision International Group. Sản phẩm là bước đột phá mới trong các phương pháp giảm cân hiện nay.'),
('brand6', 'ANGELA GOLD', 'https://lh3.googleusercontent.com/p/AF1QipO3AoImWTl09fVmhpcPpQk6B9VAZpMWA-LYrao=w1080-h608-p-no-v0', 'Angela Gold là sản phẩm hỗ trợ sức khỏe, sắc đẹp và sinh lý dành riêng cho phụ nữ. Giúp bạn tận hưởng cuộc sống một cách trọn vẹn nhất, theo cách của bạn. 100% thành phần của Angela Gold đều có nguồn gốc tự nhiên, chất lượng và độ an toàn đã được kiểm định khoa học khi sử dụng lâu dài. '),
('brand7', ' NUTRILITE', 'https://images.contentstack.io/v3/assets/blt6fafdbd03960426f/blt2e2e00bf0bba2313/6451d2817f34014b36bf077f/Nutrilite_logo_new-3_2.jpg', 'Các nhà khoa học của Nutrilite đã dày công nghiên cứu áp dụng các phương pháp canh tác hữu cơ vào quy trình trồng trọt, thu hoạch và chế biến. Nutrilite đảm bảo mỗi sản phẩm đều tận dụng được giá trị dinh dưỡng từ thiên nhiên'),
('brand8', 'NUSKIN', 'https://file.hstatic.net/1000312720/file/nuskin-viet-nam_grande.png', 'Nuskin là một trong những thương hiệu hàng đầu về thực phẩm bổ sung dinh dưỡng, người tiêu dùng Mỹ đã bình chọn các sản phẩm của Nuskin trong 100 thương hiệu hàng đầu. '),
('brand9', 'HASAKI', 'https://ogimgs.apkcombo.org/eyJsb2dvIjoiaHR0cHM6Ly9wbGF5LWxoLmdvb2dsZXVzZXJjb250ZW50LmNvbS9zYjVqbXl5N0cydks2eTU3MXhmOWFMSlhyNHZaMTJ0cmNCSGpXODZpTWw5ZkRJbEhxUHlNOWplbHJRaURaVDU1QXlRPXMyMDAiLCJ0aXRsZSI6ICJIYXNha2kudm4gQVBLIn0=/hasaki-vn-apk', 'Một trong những địa chỉ uy tín nhất có bán thực phẩm chức năng mà đồng hồ Hải Triều muốn nhắc đến chính là Hasaki. Nơi đây cung cấp đầy đủ các mặt hàng về sản phẩm chức năng tốt nhất có tại thị trường. Những thương hiệu nổi tiếng đều được Hasaki hợp tác để đem đến những sản phẩm chất lượng nhất. ');

