INSERT INTO `news` (`newsId`, `newsTitle`, `newsImage`, `newsImgTitle`, `newsContent`, `newsCreatedDate`, `newsLastUpdate`) VALUES
(11, 'Review top 10 thực phẩm chức năng hỗ trợ giảm triệu chứng thoái hóa khớp tại nhà thuốc ', 'data:image/jpeg;base64,', 'Homie.jpg', 'Đặc điểm các thực phẩm bổ trợ cho thoái hóa khớp\r\nHiện nay, trên thị trường có rất nhiều loại thực phẩm chức năng bổ trợ điều trị các bệnh liên quan đến xương khớp, trong đó có thoái hóa khớp. Đây là những sản phẩm chứa các thành phần cần thiết cho sản xuất tế bào xương và hỗ trợ tái tạo sụn khớp, cung cấp dịch khớp để khớp có thể hoạt động linh hoạt, giảm đi các triệu chứng của thoái hóa\r\n\r\nCác sản phẩm này, chủ yếu sẽ chứa một trong các thành phần sau:\r\n\r\nGlucosamine: Là amino acid ở hầu hết các mô cơ thể, đặc biệt là mô liên kết và mô sụn của khớp. Hoạt chất này tham gia cấu tạo nên sợi collagen làm chậm quá trình thoái hóa và giúp khớp được hoạt động dễ dàng\r\nChondroitin: Tham gia vào việc hình thành cấu trúc Collagen type 2, đồng thời có hoạt tính chống viêm\r\nCollagen: Thành phần quan trọng giúp tái tạo sụn và làm chậm quá trình thoái hóa khớp\r\nMSM: Nuôi dưỡng và phục hồi sụn, tạo lớp đệm cho khớp', '0000-00-00', '2023-08-15');
INSERT INTO `news` (`newsId`, `newsTitle`, `newsImage`, `newsImgTitle`, `newsContent`, `newsCreatedDate`, `newsLastUpdate`) VALUES
(14, 'Lão hóa da là gì? Dược sĩ nhà thuốc có biết những nguyên nhân làm lão hóa da ở phái đẹp (edit)', 'data:image/jpeg;base64,', 'Homie.jpg', 'Tình trạng lão hóa da ngày càng trẻ hóa do nhiều nguyên nhân khác nhau do thời tiết, ăn uống hay chế độ sinh hoạt.  Điều này khiến cho nhiều khách hàng bắt đầu lo lắng cho làn da của mình ngay khi còn trẻ. Vậy lão hóa da là gì và nguyên nhân nào gây nên sự lão hóa. PharmaDi xin chia sẻ tới các nhà thuốc những thông tin chi tiết nhất về vấn đề này qua bài viết dưới đây\r\n\r\n1. Lão hóa da là gì?\r\nLão hóa da là quá trình suy giảm chức năng của da, khiến độ đàn hồi của da giảm đi và các mô liên kết bắt đầu yếu dần, kết cấu collagen, elastine cũng dần trở nên lỏng lẻo. Bên cạnh đó tuần hoàn máu và hệ bạch huyết suy giảm, làm hủy hoại cấu trúc nền của da, làm suy yếu mao mạch dưới da, độc tố không đào thải được ra ngoài… Quá trình lão hóa sẽ dẫn tới sự suy giảm chức năng của da, thể tích da, mật độ da, đặc biệt là collagen mất đi đến 1% mỗi năm ở phụ nữ làm cho da dần mất đi sự đàn hồi và tươi trẻ\r\n\r\nVậy, những dấu hiệu của lão hóa da là gì?\r\n\r\n2. Dấu hiệu lão hóa da\r\nDa hình thành các nếp nhăn và nếp gấp : Các nếp nhăn xuất hiện ở các vị trí khác nhau của gương mặt là dấu hiệu dễ nhận biết nhất của lão hóa da. Ví dụ như trên trán bắt đầu hình thành các nếp nhăn dễ thấy nông hoặc sâu. Vết chân chim ở đuôi mắt xuất hiện rõ hơn khi cười nhẹ hoặc nói chuyện.\r\n\r\nDa khô, thiếu sức sống: Khi da bị lão hóa, lớp sừng bị tác động dần bởi quá trình lão hóa bên trong và các yếu tố bên ngoài khiến chức năng bảo vệ da bị thương tổn. Nó không thể giữ ẩm hiệu quả cho da. Kết quả là da trở nên khô và thô ráp. Quá trình lão hóa làm hư tổn cấu trúc nền, dẫn đến thiếu hụt thành phần Proteoglycans có tác dụng dưỡng ẩm nên da ngày càng khô.\r\n\r\nDa bị chùng nhão, chảy xệ, không còn tính đàn hồi:  Khi tuổi cao, da sẽ bị mất đi các sợi Collagen, Elastin, Laminin, Fibronectin – là những mô liên kết tạo bộ khung vững chắc cho da gọi là cấu trúc nền. Khi cấu trúc nền bị hư tổn, da bị chùng xuống, không còn căng mịn, mất tính đàn hồi.\r\n\r\nDa bị sạm màu và xuất hiện các đốm: Do sự tích tụ của melanin và các tác hại từ môi trường trong khi da mất đi các yếu tố bảo vệ khi bị lão hóa khiến da xuất hiện các vết nám, tàn nhang, đồi mồi.\r\n\r\nDa thô và lỗ chân lông to: Các sợi collagen và elastin bị phá hủy hoặc không sản xuất đủ làm da mất tính đàn hồi, lỗ chân lông tự nhiên của da trở nên lớn hơn, do đó làm cho da trông thô và lỗ chân lông mở rộng hơn', '0000-00-00', '2023-08-15');
INSERT INTO `news` (`newsId`, `newsTitle`, `newsImage`, `newsImgTitle`, `newsContent`, `newsCreatedDate`, `newsLastUpdate`) VALUES
(17, '10 thực phẩm giúp trì hoãn lão hóa da hiệu quả, dược sĩ nhà thuốc có biết?', 'data:image/jpeg;base64,', 'Homie.jpg', 'Lão hóa là tình trạng làn da bắt đầu xuất hiện các nếp nhăn, da khô và dễ thâm sạm. Chính vì vậy, đây là điều mà các chị em phụ nữ lo lắng và sợ gặp phải nhất. Họ luôn muốn có được một chuyên gia tư vấn và chăm sóc sức khỏe và làn da cho mình. Là một dược sĩ nhà thuốc, bạn cần nắm vững được các kiến thức liên quan để tư vấn cho khách hàng của mình, trong đó kiến thức về các thực phẩm bổ sung hàng ngày là cần thiết. PharmaDi xin giới thiệu tới các dược sĩ top 10 thực phẩm giúp làm giảm tình trạng lão hóa da ở bài viết này\r\n\r\n1. Công dụng của thực phẩm đối với làn da\r\nĐến một độ tuổi nhất định, làn da sẽ có dấu hiệu lão hóa với các biểu hiện như:  da sạm, xỉn màu, khô ráp, nhiều nếp nhăn ở vùng mắt, trán, cổ, da kém đàn hồi, chùng nhão. Việc dưỡng da từ bên ngoài là cần thiết, bên cạnh đó, khách hàng cần bổ sung chế độ dinh dưỡng và sinh hoạt điều độ để có thể cải thiện làn da\r\n\r\nThực phẩm có thể ảnh hưởng đến sức khỏe của làn da. Một chế độ ăn uống cân bằng và đủ chất dinh dưỡng có thể giúp cải thiện sức khỏe và bề ngoài của làn da. Dưới đây là một số công dụng của thực phẩm đối với làn da đặc biệt là đối với các làn da đang dần bị lão hóa hay dần có dấu hiệu bị lão hóa\r\n\r\nCải thiện độ ẩm của da: Những thực phẩm giàu vitamin E sẽ giúp duy trì độ ẩm cho da và giúp làn da mềm mại, mịn màng hơn tránh tình trạng thô ráp\r\n\r\nTăng cường sản xuất collagen: Collagen là một loại protein quan trọng giúp đàn hồi cho da. Những thực phẩm giàu vitamin C sẽ  giúp tăng cường sản xuất collagen và giảm sự xuất hiện của nếp nhăn trên da.\r\n\r\nNgăn ngừa tác hại từ tia UV: Thực phẩm giàu chất chống oxy hóa giúp ngăn ngừa tác hại từ tia UV và giảm sự xuất hiện của đốm nâu và sạm da.\r\n\r\nTăng cường sức đề kháng cho da: Những thực phẩm giàu vitamin A giúp tăng cường sức đề kháng cho da, giảm sự xuất hiện của mụn trứng cá và da khô.\r\n\r\nVậy lão hóa da nên ăn gì , thực phẩm nào chống lão hóa hiệu quả, nhà thuốc có thể tham khảo danh sách dưới đây để có được lượng kiến thức tư vấn cho khách hàng của mình nhé\r\n\r\n2. 10 thực phẩm giúp trì hoãn làn da lão hóa\r\nTrái cây và rau xanh là những thực phẩm an toàn và lành mạnh nhất giúp làn da tươi trẻ và giảm đi tình trạng lão hóa bên cạnh đó, khách hàng cũng có thể bổ sung 1 số loại cá béo thích hợp và chế độ ăn uống của mình. Dưới đây là 10 thực phẩm tốt cho sức khỏe làn da\r\n\r\nTrái cây chứa nhiều chất chống oxy hóa\r\nTrái cây như dâu tây, việt quất, mâm xôi, táo, cam, kiwi, quả mọng, nho đen… chứa nhiều chất chống oxy hóa giúp ngăn ngừa sự lão hóa của da, bảo vệ làn da khỏi tác hại của các gốc tự do và tia cực tím. Bên cạnh đó, các loại trái cây này còn có nhiều loại vitamin cần thiết để nuôi dưỡng làn da từ sâu bên trong.', '0000-00-00', '0000-00-00');
INSERT INTO `news` (`newsId`, `newsTitle`, `newsImage`, `newsImgTitle`, `newsContent`, `newsCreatedDate`, `newsLastUpdate`) VALUES
(18, 'Sốt xuất huyết: Nguyên nhân, triệu chứng và cách điều trị', 'data:image/jpeg;base64,', 'Homie.jpg', 'NGUYÊN NHÂN MẮC BỆNH SỐT XUẤT HUYẾT:\r\n\r\nNgười nhiễm virus dengue do muỗi cái thuộc chi Aedes đốt. Muỗi Aedes aegypti là véc tơ truyền bệnh chủ yếu ở hầu hết các khu vực bệnh lưu hành. Muỗi Aedes aegypti hoạt động vào ban ngày và chỉ có muỗi cái mới đốt người và truyền bệnh. Khi muỗi cái Aedes hút máu bệnh nhân nhiễm virus dengue, virus này sẽ ủ bệnh trong cơ thể muỗi khoảng 8 đến 11 ngày. Trong khoảng thời gian sống còn lại sau đó, muỗi có nguy cơ truyền bệnh cho người. Khi virus vào cơ thể người, chúng tuần hoàn trong máu từ 2 đến 7 ngày. Trong khoảng thời gian này nếu muỗi Aedes hút máu thì virus được truyền cho muỗi.\r\nNgười là ổchứa virus chính. Ngoài ra người ta mới phát hiện ở Malaysia có loài khỉ sống ở các khu rừng nhiệt đới cũng mang virus dengue. Aedes aegypti có nguồn gốc từ châu Phi. Loài muỗi này dần dần lan tràn ra hầu hết các khu vực có khí hậu nhiệt đới đầu tiên là nhờtàu thuyền và sau đó có thểcảmáy bay nữa . Ngày nay có hai loài phụ của Aedes aegypti là Aedes aegypti queenslandensis, một dạng hoang dã ởchâu Phi không phải là véc tơtruyền bệnh chính, và Aedes aegypti formosuslà muỗi sống ởkhu vực đô thị vùng nhiệt đới và là véc tơtruyền bệnh chính. Trong quá khứ, muỗi Aedes aegypti phải nhờvào các vũng nước mưa đểđẻtrứng. Tuy nhiên ngày nay quá trình đô thịhóa diễn ra với tốc độ ồ ạt đang cung cấp cho muỗi những hồnước nhân tạo đểmuỗi đẻtrứng dễdàng hơn nhiều.', '0000-00-00', '0000-00-00');
