INSERT INTO `news` (`newsId`, `newsTitle`, `newsImage`, `newsImgTitle`, `newsContent`, `newsCreatedDate`, `newsLastUpdate`) VALUES
(20, 'Sử dụng men vi sinh thay kháng sinh', 'data:image/jpeg;base64,', 'Homie.jpg', 'PharmaDi – nền tảng phân phối Thực phẩm chức năng chính hãng B2B dành cho Nhà thuốc \r\nBài viết liên quan\r\n10 thực phẩm giúp trì hoãn lão hóa da hiệu quả, dược sĩ nhà thuốc có biết?\r\nBí quyết chăm sóc da khô hiệu quả tại nhà thuốc cho phái đẹp\r\nLão hóa da là gì? Dược sĩ nhà thuốc có biết những nguyên nhân làm lão hóa da ở phái đẹp\r\nOenobiol Chute de Cheveux xóa tan nỗi lo rụng tóc trong vòng 14 ngày – sản phẩm chính hãng tại nhà thuốc\r\nReview top 10 thực phẩm chức năng hỗ trợ giảm triệu chứng thoái hóa khớp tại nhà thuốc', '0000-00-00', '0000-00-00');
INSERT INTO `news` (`newsId`, `newsTitle`, `newsImage`, `newsImgTitle`, `newsContent`, `newsCreatedDate`, `newsLastUpdate`) VALUES
(21, 'Bật mí 5 nguyên nhân rụng tóc nhiều và cách chăm sóc tóc hiệu quả, dược sĩ nhà thuốc cần biết', 'data:image/jpeg;base64,', 'Homie.jpg', 'Rụng tóc là vấn đề thường gặp ở nhiều lứa tuổi khác nhau và gặp nhiều hơn ở nữ giới ảnh hưởng đến thẩm mỹ khiến cho họ cảm thấy mất tự tin. Để hiểu rõ hơn về nguyên nhân và cách chăm sóc tóc hiệu quả hãy tham khảo bài viết dưới đây. \r\n\r\n1. 5 nguyên nhân gây rụng tóc nhiều thường gặp \r\nRụng tóc là hiện tượng sinh lý bình thường của con người. Một người bình thường trung bình mỗi ngày có thể rụng từ 50- 100 sợi tóc. Tuy nhiên, số lượng tóc là rất lớn và tóc thường xuyên mọc lại nên sự rụng tóc này thường không đáng chú ý. \r\n\r\nRụng tóc được coi là bệnh lý khi số lượng tóc rụng hàng ngày nhiều hơn so với lượng tóc mọc làm lộ chân tóc, dẫn tới tình trạng hói cả mảng lớn trên da đầu. Điều này làm cho người rụng tóc cảm thấy mất tự tin. Vậy nguyên nhân nào dẫn đến tình trạng rụng tóc nhiều như vậy, dược sĩ nhà thuốc lưu ý một số điều sau: \r\n\r\n1.1. Do tuổi tác\r\nKhi tuổi càng cao, quá trình lão hóa trong cơ thể diễn ra nhanh hơn, tóc sẽ mọc chậm lại dần. Đến một thời điểm, các nang tóc sẽ ngừng phát triển làm cho mái tóc mỏng dần đi và đổi màu. Vì vậy, người ở độ tuổi trung niên thường xuất hiện tóc bạc, tóc bị rụng nhiều. \r\n\r\n1.2. Nội tiết tố trong cơ thể bị thay đổi\r\nNội tiết tố thay đổi trong cơ thể là quá trình sinh lý bình thường và là nguyên nhân gây ra rụng tóc gặp ở cả nam và nữ.\r\n\r\nỞ nữ giới, giai đoạn thay đổi nội tiết tố trong cơ thể biểu hiện rõ nhất là giai đoạn mãn kinh (45- 55 tuổi). Khi các thụ thể androgen trên da được kích hoạt và làm cho nang tóc thu nhỏ lại dẫn tới tóc rụng nhiều. Quá trình mang thai, sử dụng thuốc tránh thai cũng làm rối loạn nội tiết tố và có khả năng rụng nhiều tóc. Ở nam giới, hormon nội tiết testosteron thay đổi làm cho tóc rụng. \r\n\r\n1.3. Căng thẳng, stress\r\nCăng thẳng stress là nguyên nhân phổ biến gây rụng tóc, đặc biệt đối với thế hệ trẻ hiện nay khi nhiều áp lực trong công việc cũng như trong cuộc sống. Điều này dẫn đến nội tiết tố trong cơ thể thay đổi, rối loạn làm cho tóc dễ bị gãy rụng.', '2023-08-14', '0000-00-00');
INSERT INTO `news` (`newsId`, `newsTitle`, `newsImage`, `newsImgTitle`, `newsContent`, `newsCreatedDate`, `newsLastUpdate`) VALUES
(22, 'Review top 10 thực phẩm chức năng hỗ trợ giảm triệu chứng thoái hóa khớp tại nhà thuốc (edit)', 'data:image/jpeg;base64,', 'Homie.jpg', 'Đặc điểm các thực phẩm bổ trợ cho thoái hóa khớp\r\nHiện nay, trên thị trường có rất nhiều loại thực phẩm chức năng bổ trợ điều trị các bệnh liên quan đến xương khớp, trong đó có thoái hóa khớp. Đây là những sản phẩm chứa các thành phần cần thiết cho sản xuất tế bào xương và hỗ trợ tái tạo sụn khớp, cung cấp dịch khớp để khớp có thể hoạt động linh hoạt, giảm đi các triệu chứng của thoái hóa\r\n\r\nCác sản phẩm này, chủ yếu sẽ chứa một trong các thành phần sau:\r\n\r\nGlucosamine: Là amino acid ở hầu hết các mô cơ thể, đặc biệt là mô liên kết và mô sụn của khớp. Hoạt chất này tham gia cấu tạo nên sợi collagen làm chậm quá trình thoái hóa và giúp khớp được hoạt động dễ dàng\r\nChondroitin: Tham gia vào việc hình thành cấu trúc Collagen type 2, đồng thời có hoạt tính chống viêm\r\nCollagen: Thành phần quan trọng giúp tái tạo sụn và làm chậm quá trình thoái hóa khớp\r\nMSM: Nuôi dưỡng và phục hồi sụn, tạo lớp đệm cho khớp', '2023-08-15', '2023-08-15');
