(23, 'Review top 10 thực phẩm chức năng hỗ trợ giảm triệu chứng thoái hóa khớp tại nhà thuốc (edit)', 'data:image/jpeg;base64,', 'Homie.jpg', 'Đặc điểm các thực phẩm bổ trợ cho thoái hóa khớp\r\nHiện nay, trên thị trường có rất nhiều loại thực phẩm chức năng bổ trợ điều trị các bệnh liên quan đến xương khớp, trong đó có thoái hóa khớp. Đây là những sản phẩm chứa các thành phần cần thiết cho sản xuất tế bào xương và hỗ trợ tái tạo sụn khớp, cung cấp dịch khớp để khớp có thể hoạt động linh hoạt, giảm đi các triệu chứng của thoái hóa\r\n\r\nCác sản phẩm này, chủ yếu sẽ chứa một trong các thành phần sau:\r\n\r\nGlucosamine: Là amino acid ở hầu hết các mô cơ thể, đặc biệt là mô liên kết và mô sụn của khớp. Hoạt chất này tham gia cấu tạo nên sợi collagen làm chậm quá trình thoái hóa và giúp khớp được hoạt động dễ dàng\r\nChondroitin: Tham gia vào việc hình thành cấu trúc Collagen type 2, đồng thời có hoạt tính chống viêm\r\nCollagen: Thành phần quan trọng giúp tái tạo sụn và làm chậm quá trình thoái hóa khớp\r\nMSM: Nuôi dưỡng và phục hồi sụn, tạo lớp đệm cho khớp', '2023-08-15', '2023-08-15');

