INSERT INTO `product` (`SKU`, `tagId`, `brandId`, `cateId`, `prodName`, `prodCountry`, `prodStatus`, `prodCreatedDate`, `prodLastUpdate`, `prodCreatedUser`, `prodLastUpdateUser`, `prodIngredient`, `prodDosageForms`, `prodUnit`, `prodDescrip`, `prodDosage`, `prodPrice`, `prodPriceSale`, `prodSellNumber`) VALUES
('111', 'tag10', 'brand13', 'cate6', 'Poncityl 500 Mekophar (C/100v)', 'Vietnam', 1, '2023-08-14', '2023-08-14 00:00:00', NULL, NULL, 'Acid Mefenamic', 'Dạng viên nén', 'Chai 100 viên nén ba', 'Nếu trường hợp quá liều xảy ra, đề nghị đến ngay cơ sở y tế gần nhất để nhân viên y tế có phương pháp xử lý.', 'Nên uống trong bữa ăn, mỗi đợt điều trị không nên quá 7 ngày.\r\nNgười lớn và trẻ em trên 12 tuổi: uống 1 viên/lần, ngày 3 lần.', '123444', '123000', 1),
('123', 'tag1', 'brand12', 'cate11', 'Enterogermina 2 Billion/5ml Sanofi (H/20o/5ml)', 'Ukraine', 1, '2023-08-14', '2023-08-15 00:00:00', NULL, NULL, 'Bacillus Clausii 2 tỷ bào tử', 'Dạng dung dịch', 'Hộp 20 ống x 5ml', 'Thuốc Enterogermina được chỉ định dùng trong các trường hợp sau:\r\n\r\nĐiều trị, phòng ngừa rối loạn hệ vi khuẩn đường ruột và bệnh lý kém hấp thu vitamin nội sinh.\r\nĐiều trị hỗ trợ để phục hồi hệ vi khuẩn đường ruột bị ảnh hưởng khi dùng thuốc kháng sinh hoặc hóa trị liệu.\r\nRối loạn tiêu hóa cấp và mạn tính ở trẻ em do nhiễm độc hoặc rối loạn hệ vi khuẩn đường ruột và kém hấp thu vitamin.', 'Người lớn: Uống 2-3 ống/ngày.\r\n\r\nTrẻ em: Uống 1-2 ống/ngày.\r\n\r\nTrẻ nhỏ: Uống 1-2 ống/ngày.\r\n\r\nLưu ý quan trọng: Không dùng quá liều khuyến cáo. Liều dùng trên chỉ mang tính chất tham khảo. Liều dùng cụ thể tùy thuộc vào thể trạng và mức độ diễn tiến của bệnh. Để có liều dùng phù hợp, bạn cần tham khảo ý kiến bác sĩ hoặc chuyên viên y tế.', '100000', '99000', 0),
('1234', 'tag12', 'brand12', 'cate12', 'Nước Uống Chống Say Tàu Xe Dongsung (H/30c/30ml)', 'United Arab Emirates', 1, '2023-08-14', '2023-08-14 00:00:00', NULL, NULL, 'Nước chống say tàu xe Dongsung Hàn Quốc 30ml không dùng cho người có tiền sử mẫn cảm với thành phần trong công thức.\r\n\r\nSản phẩm chống chỉ định sử dụng cho trẻ em chưa đủ 7 tuổi.', 'Chưa có ghi nhận', 'Hộp 30 chai x 30ml', 'Nhà Sản Xuất\r\n\r\nDongsung\r\nNước Sản Xuất\r\n\r\nSouth Korea\r\n\r\nThông Tin\r\n\r\nNước chống say tàu xe Dongsung Hàn Quốc 30ml có tác dụng phòng và giảm triệu chứng say tàu xe như:\r\nGiảm tiết dịch, do đó giảm cảm giác buồn nôn, chảy nước miếng khi lên xe.\r\nPhòng và giảm nôn khi đi ngồi trên tàu xe, máy bay.\r\nChống chóng mặt, đau đầu khi di chuyển mà không gây cảm giác buồn ngủ.', 'Thuốc say xe Hàn Quốc Dongsung 30ml nên được để ở nơi tránh ánh nắng mặt trời chiếu vào.\r\n\r\nSản phẩm được để ở nơi nhiệt độ dưới 30 độ, tránh xa tầm tay của trẻ em.', '460000', '450000', 0),
('152', 'tag7', 'brand12', 'cate7', 'Dolfenal Acid Mefenamic 500mg United (H/100v)', 'British Indian Ocean Territory', 1, '2023-08-14', '2023-08-14 00:00:00', NULL, NULL, 'Acid Mefenamic', 'Dolfenal chỉ định để làm giảm các chứng đau của cơ thể và các chứng đau do thần kinh từ nhẹ đến trung bình, nhức đầu, đau nửa đầu, đau do chấn thương, đau sau sinh, đau sau phẫu thuật, đau răng, đau và sốt theo sau các chứng viêm, đau bụng kinh, chứng rong kinh kèm với đau do co thắt hay đau hạ vị.', 'Hộp 20 ống x 5ml', 'Chống chỉ định Dolfenal trong các trường hợp:\r\n\r\nMẫn cảm với acid mefenamic hoặc với bất kỳ thành phần nào của thuốc.\r\nSuy chức năng gan hoặc thận.', 'Dùng cho trẻ em trên 12 tuổi và người lớn: Dolfenal 500 mg uống 1 viên/lần x 3 lần/ngày.\r\n\r\nLưu ý: Liều dùng trên chỉ mang tính chất tham khảo. Liều dùng cụ thể tùy thuộc vào thể trạng và mức độ diễn tiến của bệnh. Để có liều dùng phù hợp, bạn cần tham khảo ý kiến bác sĩ hoặc chuyên viên y tế.', '140000', '139500', 0),
('ABC', 'tag10', 'brand1', 'cate10', 'Bút Mixtard 30 Flexpen 100iu/Ml Novo Nordisk (H/5b/3ml)', 'Vietnam', 1, '2023-08-11', '2023-08-17 00:00:00', '', '', 'Insulin Human Isophan', 'Dạng ống', 'Hộp 20 cái x 2ml', 'Liều lượng tùy thuộc vào từng cá nhân và được xác định theo nhu cầu của bệnh nhân. Nhu cầu insulin của từng cá nhân thường từ 0,3-1,0 lU/kg/ngày. Nhu cầu insulin hàng ngày có thể cao hơn ở bệnh nhân kháng insulin (ví dụ trong tuổi dậy thì hoặc do béo phì) và thấp hơn ởbệnh nhân sản xuất được lượng insulin nội sinh thặng dư. Nên có bữa ăn chính hoặc bữa ăn nhẹ chứa carbonhydrate trong vòng 30 phút sau mỗi lần tiêm.', 'Thuốc Mixtard 30 Flexpen chống chỉ định trong các trường hợp sau:\r\nQuá mẫn với hoạt chất hoặc với bất kỳ tá dược nào của thuốc.', '100000', '98000', 543),
('ABC234', 'tag2', 'brand6', 'cate8', 'ABC 234 Syrup', 'India', 1, '2023-08-17', '2023-08-17 11:30:00', NULL, NULL, 'Active Ingredient ABC 234', 'Syrup', 'Bottle of 200 ml', 'ABC 234 Syrup description goes here.', 'Take 10 ml twice a day.', '45000', '40000', 9),
('ABCb', 'tag12', 'brand12', 'cate13', 'Bảo Thanh Ngậm Vàng Hoa Linh (H/100v)', 'Cameroon', 1, '2023-08-12', '2023-08-15 00:00:00', NULL, NULL, 'Uuyên Bối Mẫu\r\n0.4g\r\nChiết Xuất Tỳ Bà Diệp\r\n0.5g\r\nSa Sâm', 'Dạng viên', 'Hộp 20 vỉ x 5 viên', 'Chống chỉ định: Trẻ em dưới 3 tuổi, trẻ em có tiền sử động kinh hoặc co giật do sốt cao. Người mẫn cảm với bất kỳ thành phần nào của thuốc.', 'Mỗi lần ngậm 1 viên. Trẻ em từ 3-10 tuổi: Ngày 3 - 4 lần. Trẻ em trên 10 tuổi: Ngày 5 - 6 lần. Người lớn: Ngày 6 - 8 lần. Thuốc dùng được cho người tiểu đường, ăn kiêng.', '100000', '90000', 64),
('DEF', 'tag6', 'brand8', 'cate9', 'Daklife Clopidogrel 75mg Tv.Pharm (H/30v)', 'India', 1, '2023-08-17', '2023-08-17 00:00:00', NULL, NULL, 'Active Ingredient DEF', 'Syrup', 'Hộp 3 vỉ x 10 viên n', 'Bệnh nhân quá mẫn với bất cứ thành phần nào của thuốc.\r\n\r\nBệnh nhân có bệnh lý về xuất huyết như loét đường tiêu hóa hay xuất huyết nội sọ.\r\n\r\nSuy gan nặng', 'Take 10 ml twice a day.', '45000', '40000', 12),
