('PQR456', 'tag6', 'brand8', 'cate9', 'PQR 456 Cream', 'France', 1, '2023-08-17', '2023-08-17 15:30:00', NULL, NULL, 'Active Ingredient PQR 456', 'Cream', 'Jar of 30 g', 'PQR 456 Cream description goes here.', 'Apply a thin layer on affected area as needed.', '48000', '44000', 8),
('Product1', 'tag12', 'brand15', 'cate11', 'Enterogermina 2 Billion/5ml Sanofi (H/20o/5ml)', 'Vietnam', 1, '2023-08-17', '2023-08-17 00:00:00', NULL, NULL, 'Diclofenac Natri (Diclofenac Sodium)', 'Viên nén bao phim', 'Hộp 1 chai 100ml', 'Voltaren chống chỉ định trên bệnh nhân suy gan nặng. Không có nghiên cứu riêng biệt được tiến hành trên bệnh nhân suy giảm chức năng gan nhẹ đến trung bình, vì vậy không đưa ra khuyến cáo điều chỉnh liều trên đối tượng bệnh nhân này. Cần thận trọng khi sử dụng Voltaren cho bệnh nhân suy giảm chức năng gan từ nhẹ đến trung bình.\r\n\r\nLiều dùng trên chỉ mang tính chất tham khảo. Liều dùng cụ thể tùy thuộc vào thể trạng và mức độ diễn tiến của bệnh. Để có liều dùng phù hợp, bạn cần tham khảo ý kiến bác sĩ hoặc chuyên viên y tế.', 'Liều khởi đầu điều trị hằng ngày được khuyến cáo là từ 100 mg đến 150 mg, với 1 viên nén uống Voltaren 100 mg dạng phóng thích kéo dài hoặc 2 viên nén phóng thích kéo dài Voltaren 75 mg.\r\n\r\nTrong các trường hợp nhẹ hơn và điều trị kéo dài, thường chỉ cần dùng 75 - 100 mg/ngày là đủ.', '879000', '850000', 1000),
('QRS', 'tag1', 'brand3', 'cate3', 'QRS Drops', 'South Africa', 1, '2023-08-17', '2023-08-17 12:45:00', NULL, NULL, 'Active Ingredient QRS', 'Drops', 'Bottle of 20 ml', 'QRS Drops description goes here.', 'Take 5 drops in water three times a day.', '42000', '38000', 11),
('RST', 'tag10', 'brand8', 'cate10', 'RST Inhaler', 'Italy', 1, '2023-08-17', '2023-08-17 15:15:00', NULL, NULL, 'Active Ingredient RST', 'Inhaler', 'Box of 1 inhaler', 'RST Inhaler description goes here.', 'Inhale as directed by healthcare provider.', '62000', '57000', 4),
('SK102234', 'tag1', 'brand13', 'cate6', 'Prospan Syrup Engelhard Arznelmittel (C/100ml)', 'Vietnam', 1, '2023-08-14', '2023-08-14 00:00:00', NULL, NULL, 'Cao Lá Thường Xuân', 'Siro ho Prospan dùng đường uống, lắc chai kỹ trước khi dùng.', 'Hộp 1 chai 100ml', 'Thuốc Prospan được chỉ định dùng trong các trường hợp sau:\r\n\r\nÐiều trị viêm đường hô hấp cấp có kèm theo ho.\r\nÐiều trị triệu chứng trong các bệnh lý viêm phế quản mạn tính.', 'Tương tác thuốc có thể ảnh hưởng đến hoạt động của thuốc hoặc gây ra các tác dụng phụ. Nên báo cho bác sĩ hoặc dược sĩ danh sách những thuốc và các thực phẩm chức năng bạn đang sử dụng. Không nên dùng hay tăng giảm liều lượng của thuốc mà không có sự hướng dẫn của bác sĩ.\r\n\r\nNgười ta vẫn chưa phát hiện được việc uống thuốc Prospan cùng với các thuốc khác có gây những tác dụng không mong muốn hay không, vì vậy việc sử dụng Prospan đồng thời với các thuốc khác, ví dụ như kháng sinh, được xem là an toàn.', '73000', '74000', 10),
('SKU0001', 'tag1', 'brand10', 'cate11', 'Prospan Syrup Engelhard Arznelmittel (C/100ml)', 'Vietnam', 1, '2023-08-14', '2023-08-14 00:00:00', NULL, NULL, 'Cao Lá Thường Xuân 700mg', 'Thực phẩm chức năng dạng nước', 'Hộp 1 chai 100ml', 'Thuốc Prospan được chỉ định dùng trong các trường hợp sau:\r\n\r\nÐiều trị viêm đường hô hấp cấp có kèm theo ho.\r\nÐiều trị triệu chứng trong các bệnh lý viêm phế quản mạn tính.', 'Siro ho Prospan dùng đường uống, lắc chai kỹ trước khi dùng.', '73', '74', 13),
